import '../../css/Login.css';
import SignUp from './SignUp';
import ForgotPassword from './ForgotPassword';
import {Link} from 'react-router-dom';

function Login() {
    return(
        <div className="login">
                <form class='loginContainer' onClick>
                    <h2 id='siginId'>Sign-in</h2>
                    <div className='formContainer'>
                        <div>
                            <label className='inputLabel'>Email <span className='asterick'>*</span></label>
                            <input type="email"></input>
                        </div>
                        <div>
                            <label className='inputLabel'>Password  <span className='asterick'>*</span></label>
                            <input type="password"></input>
                        </div>
                            <Link className='forgotpwd' to="/forgot-Password">Forgot Password?</Link>
                            <div>
                            <button type="submit">LOG IN</button>
                            </div>
                            <p>Don't have an account?</p>
                            <a href='{SignUp}'>Sign up</a>
                    </div>
                </form>
        </div>
    );
}
export default Login;
